import React from 'react';

const TdFirst = ({isPlace,data}) => {
    if (isPlace===1) {
        return (
            <div className="w-[51px] self-stretch bg-yellow-400 bg-opacity-60  border-t border-zinc-600 flex-col justify-start items-start inline-flex">
                <div className="self-stretch px-3 py-2.5 justify-start items-start inline-flex">
                    <div className="grow shrink basis-0 text-center text-white text-xs font-normal font-['Inter'] leading-none">{data}
                    </div>
                </div>
            </div>
        );
    }
    if (isPlace===2){
        return (
            <div className="w-[300px] self-stretch bg-yellow-400 bg-opacity-60 border-l border-t border-zinc-600 flex-col justify-start items-start inline-flex">
                <div className="self-stretch px-3 py-2.5 justify-center items-center inline-flex">
                    <div className="grow shrink basis-0 text-center text-white text-xl font-normal font-['Inter'] leading-none">{data}
                    </div>
                </div>
            </div>
        );
    }
    if (isPlace===3){
        return (
            <div className="w-[122px] self-stretch bg-yellow-400 bg-opacity-60 border-l border-t border-zinc-600 flex-col justify-start items-start inline-flex">
                <div className="self-stretch px-3 py-2.5 justify-center items-center inline-flex">
                    <div className="row shrink basis-0 text-center text-white text-xl font-semibold font-['Inter'] leading-none">{data}
                    </div>
                </div>
            </div>
        );
    }
    else{
        return (
            <div className="grow shrink basis-0 self-stretch bg-yellow-400 bg-opacity-60 border-l border-t border-zinc-600 flex-col justify-start items-start inline-flex">
                <div className="self-stretch px-3 py-2.5 justify-start items-start inline-flex">
                    <div className="grow shrink basis-0 text-center text-white text-xs font-normal font-['Inter'] leading-none">{data}
                    </div>
                </div>
            </div>
        );
    }
};

export default TdFirst;
